### Ubuntu 云

Ubuntu OpenStack 使您能够配置服务器并在 Ubuntu 上创建一个 OpenStack 云（来自同一个 Ubuntu Server 下载）&#12290;

[下载 Ubuntu 云](http://www.ubuntu.com/download/cloud)

### Ubuntu 服务器 (Ubuntu Server)

不管您是要配置一个简单的文件服务器或构建一个五万个节点的云，您都可以信赖 Ubuntu 服务器，并且它将为您提供五年免费升级保证&#12290;

[下载 Ubuntu 服务器](http://www.ubuntu.com/download/server)

### Ubuntu 桌面 (Ubuntu Desktop)

此系统是 Ubuntu Kylin的基石。如果您不需要 Ubuntu Kylin自带的中文界面和应用程序，请选择此选项&#12290;

[下载 Ubuntu 桌面](http://www.ubuntu.com/download/desktop)
